function toggleLights(element) {
	const currOpac = parseFloat(getComputedStyle(element).opacity);
	element.style.opacity = currOpac === 0 ? "1" : "0";
}


function controlLights(id) {
	const element = document.getElementById(id);
	const currOpac = parseFloat(getComputedStyle(element).opacity);
	element.style.opacity = currOpac === 0 ? "1" : "0";
}


const rotators = {};
function toggleRotation(id, speed = 1) {
  const element = document.getElementById(id);
  if (!rotators[id]) {
    rotators[id] = {
      isRotating: false,
      angle: 0,
      animationFrameId: null
    };
  }
  const rotator = rotators[id];
  if (!rotator.isRotating) {
    rotator.isRotating = true;
    function rotate() {
      if (!rotator.isRotating) return;
      rotator.angle = (rotator.angle + speed) % 360;
      const bbox = element.getBBox();
      const cx = bbox.x + bbox.width / 2;
      const cy = bbox.y + bbox.height / 2;
      element.setAttribute("transform", `rotate(${rotator.angle} ${cx} ${cy})`);
      rotator.animationFrameId = requestAnimationFrame(rotate);
    }
    rotate();
  } else {
    rotator.isRotating = false;
    cancelAnimationFrame(rotator.animationFrameId);
  }
}


const snowAnimations = new Map();
function toggleSnowAnimation(id) {
  const element = document.getElementById(id);
  if (snowAnimations.has(element)) {
    const animation = snowAnimations.get(element);
    animation.cancel(); // stop the animation loop
    snowAnimations.delete(element);
    element.style.transition = "opacity 0.5s ease";
    element.style.opacity = 0;
  } else {
    element.style.transition = "opacity 0.5s ease";
    element.style.opacity = 1;
    const animation = element.animate([
      { transform: 'translateX(0) translateY(0)', opacity: 1 },
      { transform: 'translateX(-1.2px) translateY(2px)', opacity: 1, offset: 0.3333 },
      { transform: 'translateX(1.4px) translateY(4px)', opacity: 1, offset: 0.6666 },
      { transform: 'translateX(-1.6px) translateY(6px)', opacity: 0 }
    ], {
      duration: 2000,
      iterations: Infinity,
      easing: 'linear'
    });
    snowAnimations.set(element, animation);
  }
}


const breatheanimations = {};
function controlBreathe(id) {
  const element = document.getElementById(id);
  if (!element) return;
  // If it's already animating, cancel it and hide
  if (breatheanimations[id]) {
    breatheanimations[id].cancel();
    delete breatheanimations[id];
    element.style.opacity = "0";
    return;
  }
  // Start breathe animation using Web Animations API
  const animation = element.animate(
    [
      { opacity: 1 },
      { opacity: 0.3 },
      { opacity: 1 }
    ],
    {
      duration: 3000,
      iterations: Infinity,
      easing: "ease-in-out"
    }
  );
  breatheanimations[id] = animation;
  element.style.opacity = "1"; // Ensure visibility on start
}

const animationStates = {};       // Tracks running animations
const animationDirections = {};   // Tracks current direction (1 or -1)
const animationBounds = {};       // Stores computed min/max per element
function toggleBackAndForthAnimation(id, options = {}) {
  const {
    step = 0,
    interval = 30,
    path = "", // "hori" = cx, "vert" = cy
    min = 0,
    max = 0
  } = options;
  if (animationStates[id]) {
    clearInterval(animationStates[id]);
    delete animationStates[id];
    delete animationDirections[id];
    delete animationBounds[id];
    return;
  }
  const elem = document.getElementById(id);
  if (!elem) return;
  const attr = (path === "hori") ? "x" : "y";
  const currentPos = parseFloat(elem.getAttribute(attr));
  animationBounds[id] = {
    min: currentPos + min,
    max: currentPos + max
  };
  animationDirections[id] = 1;
  animationStates[id] = setInterval(() => {
    let pos = parseFloat(elem.getAttribute(attr));
    if (pos >= animationBounds[id].max || pos <= animationBounds[id].min) {
      animationDirections[id] *= -1;
    }
    const newPos = pos + step * animationDirections[id];
    elem.setAttribute(attr, newPos);
  }, interval);
}

function delayDisplay(id) {
  const element = document.getElementById(id);
  if (!element) return;

  // Start hidden with smooth transition
  element.style.opacity = "0";
  element.style.transition = "opacity 1s ease-in-out";

  // Show after 15 seconds with fade-in
  setTimeout(() => {
    element.style.opacity = "1";
  }, 20000);
}

function startGlowEffect(id) {
  const element = document.getElementById(id);
  if (!element) return;
  element.style.opacity = "1"; // Ensure it's visible
  element.animate( // Start breathe animation using Web Animations API
    [
      { opacity: 0.35 },
      { opacity: 0.7 },
      { opacity: 1 },
      { opacity: 0.7 },
      { opacity: 0.35 }
    ],
    {
      duration: 1500,
      iterations: Infinity,
      easing: "ease-in-out"
    }
  );
}


function popUpEffect(id) {
  const element = document.getElementById(id);
  if (!element) return;
  element.style.opacity = "1"; // Ensure it's visible
  element.animate( // Start breathe animation using Web Animations API
    [
      { opacity: 0.35 },
      { opacity: 0.7 },
      { opacity: 1 },
      { opacity: 0.7 },
      { opacity: 0.35 }
    ],
    {
      duration: 2000,
      iterations: 10,
      easing: "ease-in-out"
    }
  );
  setTimeout(() => {
    element.style.opacity = "0";
  }, 10000);
}


function callToggleBackAndForthAnimation() {
  toggleBackAndForthAnimation('floatie_1', { path:'hori',step:0.10,min:-1,max:2 })
  toggleBackAndForthAnimation('floatie_2', { path:'hori',step:0.05,min:-2,max:1 })
}


window.addEventListener("DOMContentLoaded", () => { // Run on load
  startGlowEffect("pathroom"); // Replace with actual element ID
  popUpEffect("prompt")
  delayDisplay("portal")
});
